import React, { useEffect } from "react";
import { addToOrder } from "./store/reducer";
export default function Menu() {
  const arr = ["aaa", "bbb", "ccc", "ddd", "eee"];
  useEffect(() => {
    arr.forEach((element) => {
      addToOrder(element);
    });
  });

  return <div>menua</div>;
}
